// that  is called byIATA

$(document).ready(function () {

  $('.ICAOSet').on('click', function () {


    var userICAOinput = $("#airportICAO").val().toUpperCase()

    

    if(byICAO.hasOwnProperty(userICAOinput)) {
      var thisLat = byICAO[`${userICAOinput}`].airportLat;
      var thisLon = byICAO[`${userICAOinput}`].airportLon;
      
      var quickICAOUrl =
      window.location.pathname +
      '?lat=' +
      thisLat +
      '&lon=' +
      thisLon +
      '&zoom=13';
      window.location = quickICAOUrl;


    } else {
      $(".ICAOHelp").append(`<p class="noDbFound">No such ICAO found</p>`)
      setTimeout(function () {
      if ($('.noDbFound').length > 0) {
        $('.noDbFound').empty();
      }
      }, 3500);
      console.log(`no such ICAO exists`)
    }

  


  })
  
  $('.airportICAO').keypress(function(e){ //user entered value into the text field()
      if(e.which == 13){//Enter key pressed
          $('.ICAOSet').click();//button
      }
});
})


